hebsuperobject.biblemap.put("b4_12_14", new hebsuperobject(4,12,14,"ויאמר יהוה אל משה ואביה ירק ירק בפניה הלא תכלם שבעת ימים תסגר שבעת ימים מחוץ למחנה ואחר תאסף׃"));
