hebsuperobject.biblemap.put("b4_14_30", new hebsuperobject(4,14,30,"אם אתם תבאו אל הארץ אשר נשאתי את ידי לשכן אתכם בה כי אם כלב בן יפנה ויהושע בן נון׃"));
