hebsuperobject.biblemap.put("b4_20_1", new hebsuperobject(4,20,1,"ויבאו בני ישראל כל העדה מדבר צן בחדש הראשון וישב העם בקדש ותמת שם מרים ותקבר שם׃"));
hebsuperobject.biblemap.put("b4_20_2", new hebsuperobject(4,20,2,"ולא היה מים לעדה ויקהלו על משה ועל אהרן׃"));
hebsuperobject.biblemap.put("b4_20_3", new hebsuperobject(4,20,3,"וירב העם עם משה ויאמרו לאמר ולו גוענו בגוע אחינו לפני יהוה׃"));
hebsuperobject.biblemap.put("b4_20_4", new hebsuperobject(4,20,4,"ולמה הבאתם את קהל יהוה אל המדבר הזה למות שם אנחנו ובעירנו׃"));
hebsuperobject.biblemap.put("b4_20_5", new hebsuperobject(4,20,5,"ולמה העליתנו ממצרים להביא אתנו אל המקום הרע הזה לא מקום זרע ותאנה וגפן ורמון ומים אין לשתות׃"));
hebsuperobject.biblemap.put("b4_20_6", new hebsuperobject(4,20,6,"ויבא משה ואהרן מפני הקהל אל פתח אהל מועד ויפלו על פניהם וירא כבוד יהוה אליהם׃"));
hebsuperobject.biblemap.put("b4_20_7", new hebsuperobject(4,20,7,"וידבר יהוה אל משה לאמר׃"));
hebsuperobject.biblemap.put("b4_20_8", new hebsuperobject(4,20,8,"קח את המטה והקהל את העדה אתה ואהרן אחיך ודברתם אל הסלע לעיניהם ונתן מימיו והוצאת להם מים מן הסלע והשקית את העדה ואת בעירם׃"));
hebsuperobject.biblemap.put("b4_20_9", new hebsuperobject(4,20,9,"ויקח משה את המטה מלפני יהוה כאשר צוהו׃"));
hebsuperobject.biblemap.put("b4_20_10", new hebsuperobject(4,20,10,"ויקהלו משה ואהרן את הקהל אל פני הסלע ויאמר להם שמעו נא המרים המן הסלע הזה נוציא לכם מים׃"));
hebsuperobject.biblemap.put("b4_20_11", new hebsuperobject(4,20,11,"וירם משה את ידו ויך את הסלע במטהו פעמים ויצאו מים רבים ותשת העדה ובעירם׃"));
hebsuperobject.biblemap.put("b4_20_12", new hebsuperobject(4,20,12,"ויאמר יהוה אל משה ואל אהרן יען לא האמנתם בי להקדישני לעיני בני ישראל לכן לא תביאו את הקהל הזה אל הארץ אשר נתתי להם׃"));
hebsuperobject.biblemap.put("b4_20_13", new hebsuperobject(4,20,13,"המה מי מריבה אשר רבו בני ישראל את יהוה ויקדש בם׃"));
hebsuperobject.biblemap.put("b4_20_14", new hebsuperobject(4,20,14,"וישלח משה מלאכים מקדש אל מלך אדום כה אמר אחיך ישראל אתה ידעת את כל התלאה אשר מצאתנו׃"));
hebsuperobject.biblemap.put("b4_20_15", new hebsuperobject(4,20,15,"וירדו אבתינו מצרימה ונשב במצרים ימים רבים וירעו לנו מצרים ולאבתינו׃"));
hebsuperobject.biblemap.put("b4_20_16", new hebsuperobject(4,20,16,"ונצעק אל יהוה וישמע קלנו וישלח מלאך ויצאנו ממצרים והנה אנחנו בקדש עיר קצה גבולך׃"));
hebsuperobject.biblemap.put("b4_20_17", new hebsuperobject(4,20,17,"נעברה נא בארצך לא נעבר בשדה ובכרם ולא נשתה מי באר דרך המלך נלך לא נטה ימין ושמאול עד אשר נעבר גבולך׃"));
hebsuperobject.biblemap.put("b4_20_18", new hebsuperobject(4,20,18,"ויאמר אליו אדום לא תעבר בי פן בחרב אצא לקראתך׃"));
hebsuperobject.biblemap.put("b4_20_19", new hebsuperobject(4,20,19,"ויאמרו אליו בני ישראל במסלה נעלה ואם מימיך נשתה אני ומקני ונתתי מכרם רק אין דבר ברגלי אעברה׃"));
hebsuperobject.biblemap.put("b4_20_20", new hebsuperobject(4,20,20,"ויאמר לא תעבר ויצא אדום לקראתו בעם כבד וביד חזקה׃"));
hebsuperobject.biblemap.put("b4_20_21", new hebsuperobject(4,20,21,"וימאן אדום נתן את ישראל עבר בגבלו ויט ישראל מעליו׃"));
hebsuperobject.biblemap.put("b4_20_22", new hebsuperobject(4,20,22,"ויסעו מקדש ויבאו בני ישראל כל העדה הר ההר׃"));
hebsuperobject.biblemap.put("b4_20_23", new hebsuperobject(4,20,23,"ויאמר יהוה אל משה ואל אהרן בהר ההר על גבול ארץ אדום לאמר׃"));
hebsuperobject.biblemap.put("b4_20_24", new hebsuperobject(4,20,24,"יאסף אהרן אל עמיו כי לא יבא אל הארץ אשר נתתי לבני ישראל על אשר מריתם את פי למי מריבה׃"));
hebsuperobject.biblemap.put("b4_20_25", new hebsuperobject(4,20,25,"קח את אהרן ואת אלעזר בנו והעל אתם הר ההר׃"));
hebsuperobject.biblemap.put("b4_20_26", new hebsuperobject(4,20,26,"והפשט את אהרן את בגדיו והלבשתם את אלעזר בנו ואהרן יאסף ומת שם׃"));
hebsuperobject.biblemap.put("b4_20_27", new hebsuperobject(4,20,27,"ויעש משה כאשר צוה יהוה ויעלו אל הר ההר לעיני כל העדה׃"));
hebsuperobject.biblemap.put("b4_20_28", new hebsuperobject(4,20,28,"ויפשט משה את אהרן את בגדיו וילבש אתם את אלעזר בנו וימת אהרן שם בראש ההר וירד משה ואלעזר מן ההר׃"));
hebsuperobject.biblemap.put("b4_20_29", new hebsuperobject(4,20,29,"ויראו כל העדה כי גוע אהרן ויבכו את אהרן שלשים יום כל בית ישראל׃"));
hebsuperobject.biblemap.put("b4_21_1", new hebsuperobject(4,21,1,"וישמע הכנעני מלך ערד ישב הנגב כי בא ישראל דרך האתרים וילחם בישראל וישב ממנו שבי׃"));
hebsuperobject.biblemap.put("b4_21_2", new hebsuperobject(4,21,2,"וידר ישראל נדר ליהוה ויאמר אם נתן תתן את העם הזה בידי והחרמתי את עריהם׃"));
hebsuperobject.biblemap.put("b4_21_3", new hebsuperobject(4,21,3,"וישמע יהוה בקול ישראל ויתן את הכנעני ויחרם אתהם ואת עריהם ויקרא שם המקום חרמה׃"));
hebsuperobject.biblemap.put("b4_21_4", new hebsuperobject(4,21,4,"ויסעו מהר ההר דרך ים סוף לסבב את ארץ אדום ותקצר נפש העם בדרך׃"));
hebsuperobject.biblemap.put("b4_21_5", new hebsuperobject(4,21,5,"וידבר העם באלהים ובמשה למה העליתנו ממצרים למות במדבר כי אין לחם ואין מים ונפשנו קצה בלחם הקלקל׃"));
hebsuperobject.biblemap.put("b4_21_6", new hebsuperobject(4,21,6,"וישלח יהוה בעם את הנחשים השרפים וינשכו את העם וימת עם רב מישראל׃"));
hebsuperobject.biblemap.put("b4_21_7", new hebsuperobject(4,21,7,"ויבא העם אל משה ויאמרו חטאנו כי דברנו ביהוה ובך התפלל אל יהוה ויסר מעלינו את הנחש ויתפלל משה בעד העם׃"));
hebsuperobject.biblemap.put("b4_21_8", new hebsuperobject(4,21,8,"ויאמר יהוה אל משה עשה לך שרף ושים אתו על נס והיה כל הנשוך וראה אתו וחי׃"));
hebsuperobject.biblemap.put("b4_21_9", new hebsuperobject(4,21,9,"ויעש משה נחש נחשת וישמהו על הנס והיה אם נשך הנחש את איש והביט אל נחש הנחשת וחי׃"));
hebsuperobject.biblemap.put("b4_21_10", new hebsuperobject(4,21,10,"ויסעו בני ישראל ויחנו באבת׃"));
hebsuperobject.biblemap.put("b4_21_11", new hebsuperobject(4,21,11,"ויסעו מאבת ויחנו בעיי העברים במדבר אשר על פני מואב ממזרח השמש׃"));
hebsuperobject.biblemap.put("b4_21_12", new hebsuperobject(4,21,12,"משם נסעו ויחנו בנחל זרד׃"));
