hebsuperobject.biblemap.put("b4_21_14", new hebsuperobject(4,21,14,"על כן יאמר בספר מלחמת יהוה את והב בסופה ואת הנחלים ארנון׃"));
hebsuperobject.biblemap.put("b4_21_15", new hebsuperobject(4,21,15,"ואשד הנחלים אשר נטה לשבת ער ונשען לגבול מואב׃"));
