hebsuperobject.biblemap.put("b4_21_19", new hebsuperobject(4,21,19,"וממתנה נחליאל ומנחליאל במות׃"));
hebsuperobject.biblemap.put("b4_21_20", new hebsuperobject(4,21,20,"ומבמות הגיא אשר בשדה מואב ראש הפסגה ונשקפה על פני הישימן׃"));
hebsuperobject.biblemap.put("b4_21_21", new hebsuperobject(4,21,21,"וישלח ישראל מלאכים אל סיחן מלך האמרי לאמר׃"));
hebsuperobject.biblemap.put("b4_21_22", new hebsuperobject(4,21,22,"אעברה בארצך לא נטה בשדה ובכרם לא נשתה מי באר בדרך המלך נלך עד אשר נעבר גבלך׃"));
hebsuperobject.biblemap.put("b4_21_23", new hebsuperobject(4,21,23,"ולא נתן סיחן את ישראל עבר בגבלו ויאסף סיחן את כל עמו ויצא לקראת ישראל המדברה ויבא יהצה וילחם בישראל׃"));
hebsuperobject.biblemap.put("b4_21_24", new hebsuperobject(4,21,24,"ויכהו ישראל לפי חרב ויירש את ארצו מארנן עד יבק עד בני עמון כי עז גבול בני עמון׃"));
hebsuperobject.biblemap.put("b4_21_25", new hebsuperobject(4,21,25,"ויקח ישראל את כל הערים האלה וישב ישראל בכל ערי האמרי בחשבון ובכל בנתיה׃"));
hebsuperobject.biblemap.put("b4_21_26", new hebsuperobject(4,21,26,"כי חשבון עיר סיחן מלך האמרי הוא והוא נלחם במלך מואב הראשון ויקח את כל ארצו מידו עד ארנן׃"));
hebsuperobject.biblemap.put("b4_21_27", new hebsuperobject(4,21,27,"על כן יאמרו המשלים באו חשבון תבנה ותכונן עיר סיחון׃"));
hebsuperobject.biblemap.put("b4_21_28", new hebsuperobject(4,21,28,"כי אש יצאה מחשבון להבה מקרית סיחן אכלה ער מואב בעלי במות ארנן׃"));
hebsuperobject.biblemap.put("b4_21_29", new hebsuperobject(4,21,29,"אוי לך מואב אבדת עם כמוש נתן בניו פליטם ובנתיו בשבית למלך אמרי סיחון׃"));
hebsuperobject.biblemap.put("b4_21_30", new hebsuperobject(4,21,30,"ונירם אבד חשבון עד דיבון ונשים עד נפח אשר עד מידבא׃"));
hebsuperobject.biblemap.put("b4_21_31", new hebsuperobject(4,21,31,"וישב ישראל בארץ האמרי׃"));
hebsuperobject.biblemap.put("b4_21_32", new hebsuperobject(4,21,32,"וישלח משה לרגל את יעזר וילכדו בנתיה ויירש את האמרי אשר שם׃"));
hebsuperobject.biblemap.put("b4_21_33", new hebsuperobject(4,21,33,"ויפנו ויעלו דרך הבשן ויצא עוג מלך הבשן לקראתם הוא וכל עמו למלחמה אדרעי׃"));
hebsuperobject.biblemap.put("b4_21_34", new hebsuperobject(4,21,34,"ויאמר יהוה אל משה אל תירא אתו כי בידך נתתי אתו ואת כל עמו ואת ארצו ועשית לו כאשר עשית לסיחן מלך האמרי אשר יושב בחשבון׃"));
hebsuperobject.biblemap.put("b4_21_35", new hebsuperobject(4,21,35,"ויכו אתו ואת בניו ואת כל עמו עד בלתי השאיר לו שריד ויירשו את ארצו׃"));
hebsuperobject.biblemap.put("b4_22_1", new hebsuperobject(4,22,1,"ויסעו בני ישראל ויחנו בערבות מואב מעבר לירדן ירחו׃"));
hebsuperobject.biblemap.put("b4_22_2", new hebsuperobject(4,22,2,"וירא בלק בן צפור את כל אשר עשה ישראל לאמרי׃"));
hebsuperobject.biblemap.put("b4_22_3", new hebsuperobject(4,22,3,"ויגר מואב מפני העם מאד כי רב הוא ויקץ מואב מפני בני ישראל׃"));
hebsuperobject.biblemap.put("b4_22_4", new hebsuperobject(4,22,4,"ויאמר מואב אל זקני מדין עתה ילחכו הקהל את כל סביבתינו כלחך השור את ירק השדה ובלק בן צפור מלך למואב בעת ההוא׃"));
hebsuperobject.biblemap.put("b4_22_5", new hebsuperobject(4,22,5,"וישלח מלאכים אל בלעם בן בעור פתורה אשר על הנהר ארץ בני עמו לקרא לו לאמר הנה עם יצא ממצרים הנה כסה את עין הארץ והוא ישב ממלי׃"));
hebsuperobject.biblemap.put("b4_22_6", new hebsuperobject(4,22,6,"ועתה לכה נא ארה לי את העם הזה כי עצום הוא ממני אולי אוכל נכה בו ואגרשנו מן הארץ כי ידעתי את אשר תברך מברך ואשר תאר יואר׃"));
hebsuperobject.biblemap.put("b4_22_7", new hebsuperobject(4,22,7,"וילכו זקני מואב וזקני מדין וקסמים בידם ויבאו אל בלעם וידברו אליו דברי בלק׃"));
hebsuperobject.biblemap.put("b4_22_8", new hebsuperobject(4,22,8,"ויאמר אליהם לינו פה הלילה והשבתי אתכם דבר כאשר ידבר יהוה אלי וישבו שרי מואב עם בלעם׃"));
hebsuperobject.biblemap.put("b4_22_9", new hebsuperobject(4,22,9,"ויבא אלהים אל בלעם ויאמר מי האנשים האלה עמך׃"));
hebsuperobject.biblemap.put("b4_22_10", new hebsuperobject(4,22,10,"ויאמר בלעם אל האלהים בלק בן צפר מלך מואב שלח אלי׃"));
hebsuperobject.biblemap.put("b4_22_11", new hebsuperobject(4,22,11,"הנה העם היצא ממצרים ויכס את עין הארץ עתה לכה קבה לי אתו אולי אוכל להלחם בו וגרשתיו׃"));
hebsuperobject.biblemap.put("b4_22_12", new hebsuperobject(4,22,12,"ויאמר אלהים אל בלעם לא תלך עמהם לא תאר את העם כי ברוך הוא׃"));
hebsuperobject.biblemap.put("b4_22_13", new hebsuperobject(4,22,13,"ויקם בלעם בבקר ויאמר אל שרי בלק לכו אל ארצכם כי מאן יהוה לתתי להלך עמכם׃"));
hebsuperobject.biblemap.put("b4_22_14", new hebsuperobject(4,22,14,"ויקומו שרי מואב ויבאו אל בלק ויאמרו מאן בלעם הלך עמנו׃"));
hebsuperobject.biblemap.put("b4_22_15", new hebsuperobject(4,22,15,"ויסף עוד בלק שלח שרים רבים ונכבדים מאלה׃"));
hebsuperobject.biblemap.put("b4_22_16", new hebsuperobject(4,22,16,"ויבאו אל בלעם ויאמרו לו כה אמר בלק בן צפור אל נא תמנע מהלך אלי׃"));
hebsuperobject.biblemap.put("b4_22_17", new hebsuperobject(4,22,17,"כי כבד אכבדך מאד וכל אשר תאמר אלי אעשה ולכה נא קבה לי את העם הזה׃"));
hebsuperobject.biblemap.put("b4_22_18", new hebsuperobject(4,22,18,"ויען בלעם ויאמר אל עבדי בלק אם יתן לי בלק מלא ביתו כסף וזהב לא אוכל לעבר את פי יהוה אלהי לעשות קטנה או גדולה׃"));
hebsuperobject.biblemap.put("b4_22_19", new hebsuperobject(4,22,19,"ועתה שבו נא בזה גם אתם הלילה ואדעה מה יסף יהוה דבר עמי׃"));
