hebsuperobject.biblemap.put("b4_35_16", new hebsuperobject(4,35,16,"ואם בכלי ברזל הכהו וימת רצח הוא מות יומת הרצח׃"));
hebsuperobject.biblemap.put("b4_35_17", new hebsuperobject(4,35,17,"ואם באבן יד אשר ימות בה הכהו וימת רצח הוא מות יומת הרצח׃"));
hebsuperobject.biblemap.put("b4_35_18", new hebsuperobject(4,35,18,"או בכלי עץ יד אשר ימות בו הכהו וימת רצח הוא מות יומת הרצח׃"));
hebsuperobject.biblemap.put("b4_35_19", new hebsuperobject(4,35,19,"גאל הדם הוא ימית את הרצח בפגעו בו הוא ימיתנו׃"));
hebsuperobject.biblemap.put("b4_35_20", new hebsuperobject(4,35,20,"ואם בשנאה יהדפנו או השליך עליו בצדיה וימת׃"));
hebsuperobject.biblemap.put("b4_35_21", new hebsuperobject(4,35,21,"או באיבה הכהו בידו וימת מות יומת המכה רצח הוא גאל הדם ימית את הרצח בפגעו בו׃"));
hebsuperobject.biblemap.put("b4_35_22", new hebsuperobject(4,35,22,"ואם בפתע בלא איבה הדפו או השליך עליו כל כלי בלא צדיה׃"));
hebsuperobject.biblemap.put("b4_35_23", new hebsuperobject(4,35,23,"או בכל אבן אשר ימות בה בלא ראות ויפל עליו וימת והוא לא אויב לו ולא מבקש רעתו׃"));
hebsuperobject.biblemap.put("b4_35_24", new hebsuperobject(4,35,24,"ושפטו העדה בין המכה ובין גאל הדם על המשפטים האלה׃"));
hebsuperobject.biblemap.put("b4_35_25", new hebsuperobject(4,35,25,"והצילו העדה את הרצח מיד גאל הדם והשיבו אתו העדה אל עיר מקלטו אשר נס שמה וישב בה עד מות הכהן הגדל אשר משח אתו בשמן הקדש׃"));
hebsuperobject.biblemap.put("b4_35_26", new hebsuperobject(4,35,26,"ואם יצא יצא הרצח את גבול עיר מקלטו אשר ינוס שמה׃"));
hebsuperobject.biblemap.put("b4_35_27", new hebsuperobject(4,35,27,"ומצא אתו גאל הדם מחוץ לגבול עיר מקלטו ורצח גאל הדם את הרצח אין לו דם׃"));
hebsuperobject.biblemap.put("b4_35_28", new hebsuperobject(4,35,28,"כי בעיר מקלטו ישב עד מות הכהן הגדל ואחרי מות הכהן הגדל ישוב הרצח אל ארץ אחזתו׃"));
hebsuperobject.biblemap.put("b4_35_29", new hebsuperobject(4,35,29,"והיו אלה לכם לחקת משפט לדרתיכם בכל מושבתיכם׃"));
hebsuperobject.biblemap.put("b4_35_30", new hebsuperobject(4,35,30,"כל מכה נפש לפי עדים ירצח את הרצח ועד אחד לא יענה בנפש למות׃"));
hebsuperobject.biblemap.put("b4_35_31", new hebsuperobject(4,35,31,"ולא תקחו כפר לנפש רצח אשר הוא רשע למות כי מות יומת׃"));
hebsuperobject.biblemap.put("b4_35_32", new hebsuperobject(4,35,32,"ולא תקחו כפר לנוס אל עיר מקלטו לשוב לשבת בארץ עד מות הכהן׃"));
hebsuperobject.biblemap.put("b4_35_33", new hebsuperobject(4,35,33,"ולא תחניפו את הארץ אשר אתם בה כי הדם הוא יחניף את הארץ ולארץ לא יכפר לדם אשר שפך בה כי אם בדם שפכו׃"));
hebsuperobject.biblemap.put("b4_35_34", new hebsuperobject(4,35,34,"ולא תטמא את הארץ אשר אתם ישבים בה אשר אני שכן בתוכה כי אני יהוה שכן בתוך בני ישראל׃"));
hebsuperobject.biblemap.put("b4_36_1", new hebsuperobject(4,36,1,"ויקרבו ראשי האבות למשפחת בני גלעד בן מכיר בן מנשה ממשפחת בני יוסף וידברו לפני משה ולפני הנשאים ראשי אבות לבני ישראל׃"));
hebsuperobject.biblemap.put("b4_36_2", new hebsuperobject(4,36,2,"ויאמרו את אדני צוה יהוה לתת את הארץ בנחלה בגורל לבני ישראל ואדני צוה ביהוה לתת את נחלת צלפחד אחינו לבנתיו׃"));
hebsuperobject.biblemap.put("b4_36_3", new hebsuperobject(4,36,3,"והיו לאחד מבני שבטי בני ישראל לנשים ונגרעה נחלתן מנחלת אבתינו ונוסף על נחלת המטה אשר תהיינה להם ומגרל נחלתנו יגרע׃"));
hebsuperobject.biblemap.put("b4_36_4", new hebsuperobject(4,36,4,"ואם יהיה היבל לבני ישראל ונוספה נחלתן על נחלת המטה אשר תהיינה להם ומנחלת מטה אבתינו יגרע נחלתן׃"));
hebsuperobject.biblemap.put("b4_36_5", new hebsuperobject(4,36,5,"ויצו משה את בני ישראל על פי יהוה לאמר כן מטה בני יוסף דברים׃"));
hebsuperobject.biblemap.put("b4_36_6", new hebsuperobject(4,36,6,"זה הדבר אשר צוה יהוה לבנות צלפחד לאמר לטוב בעיניהם תהיינה לנשים אך למשפחת מטה אביהם תהיינה לנשים׃"));
hebsuperobject.biblemap.put("b4_36_7", new hebsuperobject(4,36,7,"ולא תסב נחלה לבני ישראל ממטה אל מטה כי איש בנחלת מטה אבתיו ידבקו בני ישראל׃"));
hebsuperobject.biblemap.put("b4_36_8", new hebsuperobject(4,36,8,"וכל בת ירשת נחלה ממטות בני ישראל לאחד ממשפחת מטה אביה תהיה לאשה למען יירשו בני ישראל איש נחלת אבתיו׃"));
hebsuperobject.biblemap.put("b4_36_9", new hebsuperobject(4,36,9,"ולא תסב נחלה ממטה למטה אחר כי איש בנחלתו ידבקו מטות בני ישראל׃"));
hebsuperobject.biblemap.put("b4_36_10", new hebsuperobject(4,36,10,"כאשר צוה יהוה את משה כן עשו בנות צלפחד׃"));
hebsuperobject.biblemap.put("b4_36_11", new hebsuperobject(4,36,11,"ותהיינה מחלה תרצה וחגלה ומלכה ונעה בנות צלפחד לבני דדיהן לנשים׃"));
hebsuperobject.biblemap.put("b4_36_12", new hebsuperobject(4,36,12,"ממשפחת בני מנשה בן יוסף היו לנשים ותהי נחלתן על מטה משפחת אביהן׃"));
hebsuperobject.biblemap.put("b4_36_13", new hebsuperobject(4,36,13,"אלה המצות והמשפטים אשר צוה יהוה ביד משה אל בני ישראל בערבת מואב על ירדן ירחו׃"));

